  }

  return (
    <>
    <Header />
    <MainContainer/>
    <LeilaoContainer isDashBoard={false}/>
    <CarrosContainer isDashBoard={false}/>
    <MotosContainer isDashBoard={false}/>
    <Footer />
    </>
  );
};
